import Content from '../Content/Content';
import FoodAppPage from '../Content/components/FoodAppPage/FoodAppPage';


 const Home = React.memo(({loggedInUser}) => {
    return loggedInUser ? <Content/> : <Redirect to='/'/>;
});

const mapStateToProps = state => {
    return {
        loggedInUser:state.LOG_IN.loggedInUser

    }
};

